INSERT INTO `data_prodi` (`kode_prodi`, `nama_prodi`, `keterangan`, `keahlian`, `output`) VALUES
('AGBS', 'Agribisnis', 'Bidang ilmu yang mempelajari tentang  sosial ekonomi pertanian atau bisnis dalam pertanian. Dalam bidang ilmu ini mahasiswa diharap memiliki komunikasi, manajemen, analisa, dan pemahanan biologi yang baik.', 'ekonomi pertanian, budidaya pertanian, pemasaran hasil pertanian, kewirausahaan, komunikasi dan penyuluhan pertanian', 'BUMN, petani, ahli bioteknologi, wirausaha, konsultan pertanian, peneliti, sistem analis pertanian'),
('AK', 'Analis Kesehatan', 'Bidang ilmu yang dipersiapkan untuk dapat melakukan pemeriksaan, penetapan, pengukuran, serta pengujian terhadap carian dan jaringan tubuh yang dapat menentukan jenis dan penyebab penyakit. Dalam bidang ilmu ini mahasiswa banyak melakukan penelitian di laboratorium. Mahasiswa harus memiliki sifat teliti, kritis, detail, dapat menganalisa, dan bekerja sama dengan tim', 'Observasi hematologi, kimia klinik, mikrobiologi, kimia makanan, dll', 'Teknisi laboratorium klinis, teknisi alat kesehatan, ahli patologi, quality control dan product development'),
('AKN', 'Akuntansi', 'Bidang ilmu yang mempelajari tentang cara memelihara dan penyusunan keuangan. Pada program studi ini mahasiswa harus teliti dalam menghitung, menganalis, mengevaluasi, mengelola, dan meyajikan laporan keuangan.', 'manajemen, perpajakan, sistem informasi, audit, penganggaran, pelaporan', 'Pegawai bank, Makelar saham, akuntan, konsultan pajak, pegawai asuransi, Bagian keuangan, auditor'),
